import {
  lineOptions,
  lineLegends,
  realTimeUsersBarLegends,
  realTimeUsersBarOptions,
} from "../utils/demo/chartsData";
import UsersTable from "../components/UsersTable";

const Customers = () => {
  return (
    <div>
      <PageTitle>Клиенти</PageTitle>



